import React from 'react';

function signup() {
    return (
        <div className='signup-component'>
            <form>
                <div className='signup-component-usernameDiv'>
                    <label htmlFor='username'>Username:</label>
                    <input id='username' name='username'></input>
                    <label htmlFor='usernameR'>Repeat username:</label>
                    <input id='usernameR' name='usernameR'></input>
                </div>


                <label htmlFor='password'>Password:</label>
                <input id='password' name='password'></input>
                <label htmlFor='passwordR'>Repeat password:</label>
                <input id='passwordR' name='passwordR'></input>
            </form>
        </div>
    );
}

export default signup;
